import axios from "axios";
// require("dotenv").config(); add?

const baseURL = 'http://localhost:8080'; 

export const fetchTrafficUpdatesData = async (latitude: number, longitude:number) => {
  try {
    console.log(`Requesting: ${baseURL}/traffic-situations?latitude=${latitude}&longitude=${longitude}`);
    console.log("Sending request from apiService:", longitude, latitude);
    const response = await axios.get(
      `${baseURL}/traffic-situations`, {
          params: {longitude, latitude} 
      }
    );
    return response.data;
  } catch (error) {
    console.error("Error fetching traffic data:", error);
    throw error;
  }
};
